import React from "react";

const Title = () => {
  return (
    <section>
      <video
        playsInline="playsinline"
        autoplay="autoplay"
        muted="muted"
        loop="loop"
      >
        <source
          src="https://www.youtube.com/watch?v=CoAvaYOwm6k&t=25s"
          type="video/mp4"
        />
      </video>
      <div>
        <h1 className="font-weight-bold head_size_high">EXPERIENCE THE FOOD</h1>
        <p className="head_size_low">
          WISH YOU HAVE GOOD FOOD AT OUR RESTAURANT
        </p>
        <button className="head_size_low">BOOKING NOW</button>
      </div>
    </section>
  );
};

export default Title;
